import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom'; // Import useNavigate for navigation
import styles from './SignUpForm.module.css';

const SignUpForm = () => {
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [confirmPassword, setConfirmPassword] = useState("");
    const [emailError, setEmailError] = useState("");
    const [passwordError, setPasswordError] = useState("");
    const [confirmPasswordError, setConfirmPasswordError] = useState("");
    const navigate = useNavigate(); // Initialize useNavigate

    const validateEmail = (email) => {
        const pattern = /^[^ ]+@[^ ]+\.[a-z]{2,3}$/;
        return pattern.test(email);
    };

    const handleSubmit = (event) => {
        event.preventDefault();
        let valid = true;

        if (!email) {
            setEmailError("Email can't be blank");
            valid = false;
        } else if (!validateEmail(email)) {
            setEmailError("Enter a valid email address");
            valid = false;
        } else {
            setEmailError("");
        }

        if (!password) {
            setPasswordError("Password can't be blank");
            valid = false;
        } else {
            setPasswordError("");
        }

        if (password !== confirmPassword) {
            setConfirmPasswordError("Passwords do not match");
            valid = false;
        } else {
            setConfirmPasswordError("");
        }

        if (valid) {
            // Store the user's credentials (optional, for demonstration purposes)
            localStorage.setItem('email', email);
            localStorage.setItem('password', password);

            // Navigate to the home page
            navigate('/');
        }
    };

    return (
        <div className={styles.container}>
            <div className={styles.wrapper}>
                <header>Sign Up</header>
                <form onSubmit={handleSubmit}>
                    <div className={`${styles.field} ${emailError ? styles.error : ""}`}>
                        <label htmlFor="email">Email Address</label>
                        <div className={styles.inputArea}>
                            <input 
                                id="email"
                                type="text" 
                                placeholder="Enter your email" 
                                value={email} 
                                onChange={(e) => setEmail(e.target.value)} 
                            />
                            <i className={`icon fas fa-envelope ${styles.icon}`}></i>
                        </div>
                        {emailError && <div className={styles.errorTxt}>{emailError}</div>}
                    </div>
                    <div className={`${styles.field} ${passwordError ? styles.error : ""}`}>
                        <label htmlFor="password">Password</label>
                        <div className={styles.inputArea}>
                            <input 
                                id="password"
                                type="password" 
                                placeholder="Enter your password" 
                                value={password} 
                                onChange={(e) => setPassword(e.target.value)} 
                            />
                            <i className={`icon fas fa-lock ${styles.icon}`}></i>
                        </div>
                        {passwordError && <div className={styles.errorTxt}>{passwordError}</div>}
                    </div>
                    <div className={`${styles.field} ${confirmPasswordError ? styles.error : ""}`}>
                        <label htmlFor="confirmPassword">Confirm Password</label>
                        <div className={styles.inputArea}>
                            <input 
                                id="confirmPassword"
                                type="password" 
                                placeholder="Confirm your password" 
                                value={confirmPassword} 
                                onChange={(e) => setConfirmPassword(e.target.value)} 
                            />
                            <i className={`icon fas fa-lock ${styles.icon}`}></i>
                        </div>
                        {confirmPasswordError && <div className={styles.errorTxt}>{confirmPasswordError}</div>}
                    </div>
                    <button type="submit">Sign Up</button>
                </form>
                <div className={styles.signTxt}>Already a member? <a href="/login">Login now</a></div>
            </div>
        </div>
    );
};

export default SignUpForm;
